<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Timestamp Converter</title>
        <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0/css/all.min.css">

    <style>
        :root {
            --bg-color: #121212;
            --text-color: #ffffff;
            --input-bg: #1e1e1e;
            --input-border: #333333;
            --button-bg: #333333;
            --button-hover: #555555;
            --button-text: #ffffff;
            --error-color: #ff6b6b;
        }
        body {
            font-family: Arial, sans-serif;
            margin: 20px;
            background-color: var(--bg-color);
            color: var(--text-color);
        }
        h1 {
            text-align: center;
        }
        .container {
            max-width: 800px;
            margin: 0 auto;
        }
        input, select {
            padding: 10px;
            border: 1px solid #ccc;
            border-radius: 4px;
            background-color: var(--input-bg);
            color: var(--text-color);
            margin: 5px;
        }
        input {
            flex: 1;
        }
        .input-group {
            display: flex;
            align-items: center;
            margin-bottom: 10px;
        }
        button {
            background-color: var(--button-bg);
            color: var(--button-text);
            border: none;
            padding: 10px 20px;
            margin: 10px 5px;
            border-radius: 4px;
            cursor: pointer;
        }
        button:hover {
            background-color: var(--button-hover);
        }
        .result {
            margin-top: 20px;
            padding: 10px;
            border-radius: 4px;
            background-color: var(--input-bg);
        }
        .theme-toggle {
            position: absolute;
            top: 40px;
            right: 20px;
        }
        /* ===== HEADER STYLES ===== */
        .header {
            width: 100vw;
            min-width: 100vw;
            background: var(--header-bg);
            border-bottom: 1px solid var(--header-border);
            display: flex;
            align-items: center;
            justify-content: space-between;
            padding: 0 32px;
            height: 56px;
            position: fixed;
            top: 0;
            left: 0;
            z-index: 100;
            box-sizing: border-box;
        }
        .header .header-left {
            display: flex;
            align-items: center;
        }
        .header .header-title {
            font-size: 1.3em;
            font-weight: bold;
            margin-left: 10px;
            color: var(--text-color);
            letter-spacing: 1px;
        }
        .header .header-icon {
            color: var(--header-icon);
            font-size: 2em;
            cursor: pointer;
            transition: color 0.2s;
        }
        .header .header-icon:hover {
            color: var(--button-hover);
        }
        .header .header-link {
            color: var(--text-color);
            font-size: 2em;
            margin-left: 18px;
            margin-right: 0;
            transition: color 0.2s;
            text-decoration: none;
            display: flex;
            align-items: center;
            height: 56px;
        }
        .header .header-link i {
            display: block;
            font-size: 1em;
        }
        .header .header-link:hover {
            color: #0a66c2;
        }
    </style>
</head>
<body>
    <div class="header">
        <div class="header-left">
            <i class="fas fa-tools header-icon" onclick="window.location.href='index.html'" title="Dev Tools Home"></i>
            <span class="header-title">SI Dev Tools</span>
        </div>
        <a class="header-link" href="https://www.linkedin.com/in/sujeevan-ilanthirayan" target="_blank" title="My LinkedIn">
            <i class="fab fa-linkedin"></i>
        </a>
    </div>
    <h1>Timestamp Converter</h1>
    <button class="theme-toggle" onclick="toggleTheme()">Toggle Theme</button>
    <br>
    <div class="container">
        <div class="input-group">
            <input type="text" id="timestampInput" placeholder="Enter timestamp (Unix, ISO, etc.)">
            <select id="inputFormat">
                <option value="auto">Auto Detect</option>
                <option value="unix">Unix Timestamp</option>
                <option value="iso">ISO 8601</option>
                <option value="date">Date String</option>
            </select>
        </div>
        <button onclick="convertTimestamp()">Convert</button>
        <div id="result" class="result"></div>
    </div>
